import React, { Component } from "react";
import Photo from "./Photo";
import axios from "axios";

class Gallery extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: this.getData(),
			title: "",
		};
	}

	getData() {
		axios
			.get("https://api.harvardartmuseums.org/image?apikey=221b4e10-7bc5-11ea-8865-8f439f2941d8")
			.then((res) => res.data)
			.then((data) => this.setState({ image: data.records[0].baseimageurl }));
	}

	render() {
		return (
			<div>
				<Photo url={this.state.image} />
				<Photo url={this.state.image} />
				<Photo url={this.state.image} />
				<Photo url={this.state.image} />
			</div>
		);
	}
}

export default Gallery;
